sys_script_include.script:
function generateTeeTimes(tee_time) {

	try {
		var gRound = new GlideRecord('x_898924_rounds_rentals');
		gRound.initialize();
		gRound.setValue('state', 'available');
		gRound.setValue('category', 'tee_time_category');
		//gRound.round_start = tee_time;
		gRound.short_desc = tee_time;
		gRound.insert();

	} catch(error) {
		gs.error(error);
	}
}
